import React from "react";

import { Wrapper, Content } from "./Navbar.styles";

const Navbar = () => (
  <Wrapper>
    <Content>
      <h1>Mixed Tape</h1>
      <ul>
        <li>Home</li>
        <li>Login</li>
      </ul>
    </Content>
  </Wrapper>
);

export default Navbar;
